import { Box } from "@mui/system";
import { Toolbar } from "@mui/material";
import axios from 'axios';
import * as React from 'react';
import { HostsData } from "./HostsTable";
import { ControlledAccordions } from "./HostsInfo";
import { HealthStatus } from "./HostsInfo";
import { Typography } from "@material-ui/core";

const dummy:HostsData={
    _id:          "",
name:              "",
description:       "",
OS:                "",
Running_services:  0,
Running_instances: 0,
health_status:     HealthStatus["Healthy"],
services:          [{Name:"",Instances:0}]
}

export const HostsInfoLanding =()=>{

  const [data,setData]=React.useState<HostsData>(dummy);

  const getProductData = async () => {
      try {
        const data = await axios.get<HostsData>(
            'https://my-json-server.typicode.com/sakthi-vunet/dummyhostsinfo/list'
        );

        setData(data.data);
      } catch (e) {
        console.log(e);
      }
    };
  React.useEffect(() => {
      getProductData();

  }, []);

  return (
    <Box
      component="main"
      sx={{ flexGrow: 1, p: 3, marginLeft: {  sm: `200px`, md: `200px`}}}>
      <Toolbar />
      <Typography>

      </Typography>
    <ControlledAccordions data={data} />

</Box>

  );
};
